import React from 'react';

import home from './images/home.png';

export default class Calendar extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div>
                <div>
                    <button onClick={() => this.props.handleDisplayChange(0)}>
                        <img src={home}></img>
                        <p>Home</p>
                    </button>
                    <h1>Calendar</h1>
                </div>
            </div>
        )
    }
}
